@font-face{

body {
  font-family:"Lucida Grande", Arial, sans-serif;
  font-weight: normal;
  font-size: 12px;
  line-height: 14px;
}

.attribution {
  position: absolute;
  top: 5px;
  right: 5px;
  background-color: rgba(236, 182, 0, 1);
  color: rgba(255, 255, 255, 1);
  font-size: 10px;
  display: table;
  margin: 3px;
  padding: 0 3px;
  border-radius: 2px;
}

.ad-complaint {
    background: url(https://s0.shbdn.com/assets/images/complaint_alert:55999e69060bb2d4eb6cecdc78b720f9.png) no-repeat;
    background-size: 14px 14px;
    width: 14px;
    height: 14px;
    position: absolute;
    margin: 7px 2px 5px 4px;
    right: 5px;
    z-index: 99999999;
}
.image {
  margin: 0px 45px 0px 3px;
  width: 124px;
  height: 93px;
  float: left;
}
.image img {
	border: 1px solid #dedede;
}

.image img,
.image-link {
  width: 100%;
}

.title {
  margin: 3px 8px 8px 8px;
  padding-top: 23px;
  width: 650px;
}

.title a {
  color: rgba(0, 51, 153, 1);
  font-weight: bold;
  font-family:"Lucida Grande","LucidaGrande", Arial, sans-serif;
  font-size: 12px;
  line-height: 18px;
  text-decoration: none;
}

.title a:hover {
   text-decoration: underline;
}

.body {
  color: rgba(103, 103, 103, 1);
  margin: 0px 8px 8px 8px;
  width: 650px;
}

.call-to-action {
  font-family: "Lucida Grande","LucidaGrande", Arial, sans-serif;
  font-weight: normal;
  font-size: 12px;
  margin: 8px;
  position: absolute;
  top: 29px;
  right: 0px;
  line-height: 30px;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

.call-to-action a {
  text-decoration: none;
  color: #039;
}
.call-to-action a:hover {
  text-decoration: underline;
}
.ntvd_link_container:hover a.ulink{
  text-decoration: underline
}
.body-link {
  font-family: "Lucida Grande","LucidaGrande", Arial, sans-serif;
  text-decoration: none;
  color: rgba(103, 103, 103, 1);
}

.ntvd_link_container a span { 
  position:absolute; 
  width:100%;
  height:100%;
  top:0;
  left: 0;
  z-index: 1;
}
